    data.push([`${ticket.title}, ${ticket.priority}`])
  });

  const options = {
      title: "Tickets by Priority",
      chartArea:{
        width: '100%',
        height: '80%',
      },
      backgroundColor: {
        fill: '#EFEDE7',
        stroke: '#b0b0b0',
        strokeWidth: 2
      },
  }

console.log(data)

  return (
    <div>
        <Chart 
        chartType="PieChart"
        data={data}
        options={options}
        width={"100%"}
        height={"400px"}
        />
    </div>
  )
}

export default Piechart
